import React from 'react'
import './react-top-bar.css'

function TopBar(props)
{
    return(
        <div id="top-bar">
            <div id="logo-container"><img id="logo" src={props.avatarUrl} alt="Logo"/></div>
            <h1 id="company-name">{props.name}</h1>
            <ul id="social-ul">
                {Object.keys(props.social).map(site => {
                    return <li key={site} className="social-link"><a href={props.social[site]}>{site}</a></li>
                })}
            </ul>
        </div>
    )
}

export {TopBar}
